import $api from "./index";
import axios from "axios";

export const pochtaTest = async () => {
  let data = JSON.stringify({
    apiKey: "a8ce1029e7856b8a14e6b172318a0f31",
    modelName: "Address",
    calledMethod: "getSettlementAreas",
    methodProperties: {
      Ref: "",
    },
  });

  let config = {
    method: "get",
    maxBodyLength: Infinity,
    url: "https://api.novaposhta.ua/v2.0/json/a8ce1029e7856b8a14e6b172318a0f31",
    headers: {
      "Content-Type": "application/json",
    },
    data: data,
  };

  axios
    .request(config)
    .then((response) => {
      console.log(JSON.stringify(response.data));
    })
    .catch((error) => {
      console.log(error);
    });
};
